function git_add() {
    local file="${1:=.}"
    [[ $# > 1 ]] && shift;
    git add $file
}

function git_commit() {
    local message="${1:=Update source}"
    [[ $# > 1 ]] && shift;
    git commit -m $message
}

function git_push() {
    if [[ $# == 0 ]]; then
        git push
    else
        git push $*
    fi
}

function git_pull() {
    if [[ $# == 0 ]]; then
        git pull
    else
        git pull $*
    fi
}

function git_add_commit() {
    files="."
    message="Initial commit"

    function _argv=()

    for item in $*; do
        if [[ $1 == '-f' ]]; then
            shift; files="$1"
        elif [[ $1 == '-m' ]]; then
            shift; message="$1"
        else
            _argv+=" $1 "; shift
        fi
    done

    git add $files && git commit -m $message
}

function gitraw() {
  local url=''
  [[ $# > 0 ]] && url=$1; shift
  local file=''
  [[ $# > 0 ]] && file=$1; shift

  if [[ -n $url && -z $file ]]; then
    file="$(basename ${url})"
  fi

  if [[ -z $file || -z $url ]]; then
    echo -ne "
    usage: file_url [filename]
    "; return 1
  fi

  wget https://raw.githubusercontent.com/$url/$file -O $file $*
}

function newbranch () {
  local name exists count matches current_branch source_branch

  if [[ $# == 0 ]]; then
    echo "
usage: branch_name [source_branch=master]
"; return 1
  fi

  name=$1; shift

  current_branch=`git status -bs | perl -pe s/\#\#\ //gi | egrep '^[^\.]+' -o`
  if [[ -z $1 ]]; then
    source_branch=$current_branch
  else
    source_branch=$1
  fi

  count=`git branch -l | grep -w "$name" -c`
  exists=`git branch -l | grep -w "$name" -i`
  matches=0
  if [[ $count > 0 ]]; then
    echo $exists
    echo
    for (( i = 1; i <= $count; i++ )); do
      existss=`git branch -l | grep -w "$name" -i | head -n $i | tail -n 1 | perl -pe s/\ //gi`
      if [[ $name == $existss ]]; then
        matches=1
        break
      fi
    done
  fi

  echo "
creating new branch...$name
"

  if [[ $current_branch != $source_branch ]]; then
    git checkout $source_branch
    git fetch origin -a
    git pull origin $source_branch
  fi

  if [[ $matches == 1 ]]; then
    git branch -D $name
    git add .
    git commit -m "Delete branch $name and replace new branch from current"
  fi

  git branch $name

  git checkout $name
}


